export const PATHS = {
  HOME: '/',
  LOGIN: '/login',
  SIGNUP: '/signup',
  GAMES: '/games',
  PROFILE: '/profile',
  USERS: '/users',
  ERRORS: {
    NOT_FOUND: '404',
  },
};

export const AUTH_API_ENDPOINT = {
  LOGIN: 'users/login',
  SIGNUP: 'users/signup',
  PROFILE: 'users/profile',
  USERS: 'users',
  DELETE_USER: 'users/:id',
};
